import React from 'react';
import {Pie, Bar} from 'react-chartjs-2';
import "chartjs-plugin-labels";
import "../pages/main.css";
const data1 = {
  labels: ['root', 'admin', 'test',
  'user', 'ubuntu', "Other"],
  datasets: [{
    label: "Top 5 Usernames used for attempted bruteforce",
    data: [116496, 4995, 1543, 1260, 842, 79011],
    backgroundColor: [
      'rgba(255, 99, 132, 0.2)',
      'rgba(255, 159, 64, 0.2)',
      'rgba(255, 205, 86, 0.2)',
      'rgba(75, 192, 192, 0.2)',
      'rgba(54, 162, 235, 0.2)',
      'rgba(153, 102, 255, 0.2)',
      'rgba(201, 203, 207, 0.2)'
    ],
    borderColor: [
      'rgb(255, 99, 132)',
      'rgb(255, 159, 64)',
      'rgb(255, 205, 86)',
      'rgb(75, 192, 192)',
      'rgb(54, 162, 235)',
      'rgb(153, 102, 255)',
      'rgb(201, 203, 207)'
    ],
    borderWidth: 1
  }]
};

const data2 = {
  labels: ['123456', '123', 'password',
  '1234', '12345', "Other"],
  datasets: [{
    label: "Top 5 Passwords used for attempted bruteforce",
    data: [7267, 3161, 1979, 1563, 1291, 167584],
    backgroundColor: [
      'rgba(255, 99, 132, 0.2)',
      'rgba(255, 159, 64, 0.2)',
      'rgba(255, 205, 86, 0.2)',
      'rgba(75, 192, 192, 0.2)',
      'rgba(54, 162, 235, 0.2)',
      'rgba(153, 102, 255, 0.2)',
      'rgba(201, 203, 207, 0.2)'
    ],
    borderColor: [
      'rgb(255, 99, 132)',
      'rgb(255, 159, 64)',
      'rgb(255, 205, 86)',
      'rgb(75, 192, 192)',
      'rgb(54, 162, 235)',
      'rgb(153, 102, 255)',
      'rgb(201, 203, 207)'
    ],
    borderWidth: 1
  }]
};



export default class Usernames extends React.Component{
    render(){
        return(
            <div>
                    <Bar
        data = {data1}
        options = {{
            plugins:{
                labels:{
                    render: "value",
                    fontColor: "blue",
                    fontSize: 20,
                }
            }
        }}
        
        />
            </div>
            
        )
    }
}

export class Passwords extends React.Component{
  render(){
      return(
          <div>
                  <Bar
      data = {data2}
      options = {{
          plugins:{
              labels:{
                  render: "value",
                  fontColor: "blue",
                  fontSize: 20,
              }
          }
      }}
      
      />
          </div>
          
      )
  }
}

export class MalCode1 extends React.Component{
  render(){
    return(
      <text-box>hi</text-box>
    )
  }
}
